using System;
using System.Collections.Generic;
using Microsoft.EntityFrameworkCore;

namespace MediaManager.Entities
{
    public class MediaContext : DbContext
    {
        public MediaContext(DbContextOptions<MediaContext> options)
            : base(options)
        {
        }

        public DbSet<Movie> Movies { get; set; }
        public DbSet<Platform> Platforms { get; set; }
        public DbSet<MediaType> MediaTypes { get; set; }
        public DbSet<Game> Games { get; set; }


        public void EnsureSeedDataForContext()
        {
            // first, clear the database.  This ensures we can always start 
            // fresh with each demo.  Not advised for production environments, obviously :-)

            MediaTypes.AddRange(GetMediaTypes());

            Platforms.AddRange(GetPlatforms());

            Movies.RemoveRange(GetMovies());
            SaveChanges();
        }

        private static List<MediaType> GetMediaTypes()
        {
            var dvd = new MediaType
            {
                Id = new Guid("9EDF91EE-AB77-4521-A402-5F188BC0C577"),
                Name = "DVD"
            };
            var bluray = new MediaType
            {
                Id = new Guid("578359B7-1967-41D6-8B87-64AB7605587E"),
                Name = "Blu-Ray"
            };
            var mediaTypes = new List<MediaType> { dvd, bluray };
            return mediaTypes;
        }

        private static List<Platform> GetPlatforms()
        {
            var ps3 = new Platform
            {
                Id = new Guid("96EA3592-E4B6-49AA-8929-165167144F61"),
                Name = "PS3"
            };
            var ps4 = new Platform
            {
                Id = new Guid("1325360C-8253-473A-A20F-55C269C20407"),
                Name = "PS4"
            };
            var wii = new Platform
            {
                Id = new Guid("578359B7-1967-41D6-8B87-64AB7605587E"),
                Name = "Wii"
            };
            var nintendoSwitch = new Platform
            {
                Id = new Guid("F74D6899-9ED2-4137-9876-66B070553F8F"),
                Name = "Nintendo Switch"
            };

            var platforms = new List<Platform> { ps3, ps4, wii, nintendoSwitch };
            return platforms;
        }

